import React, { useState, useEffect } from 'react';
import axios from '../axiosConfig';
import { Filters, Brand, Model } from '../types';

interface FilterSidebarProps {
    onFilterChange: (filters: Filters) => void;
}

const FilterSidebar: React.FC<FilterSidebarProps> = ({ onFilterChange }) => {
    const [brands, setBrands] = useState<Brand[]>([]);
    const [models, setModels] = useState<Model[]>([]);
    const [filters, setFilters] = useState<Filters>({
        brand: '',
        model: '',
        year: '',
        quilometragem_min: '',
        quilometragem_max: ''
    });

    useEffect(() => {
        fetchBrands();
        if (filters.brand) {
          const fetchModels = async () => {
            try {
                const response = await axios.get(`/modelos/marcas/${filters.brand}/`);
                setModels(response.data);    
            } catch (error) {
                console.error('Error fetching models', error);
            }
        };
        fetchModelos();
        }
      }, [filters.brand]);

    const fetchBrands = async () => {
        try {
            const response = await axios.get<Brand[]>('/marcas'); // Define o tipo da resposta como Brand[]
            setBrands(response.data);
        } catch (error) {
            console.error('Error fetching brands', error);
        }
    };

    const fetchModels = async () => {
        try {
            const response = await axios.get<Model[]>('/modelos'); // Define o tipo da resposta como Model[]
            setModels(response.data);
        } catch (error) {
            console.error('Error fetching models', error);
        }
    };

    const handleInputChange = (e: React.ChangeEvent<HTMLSelectElement | HTMLInputElement>) => {
        const { name, value } = e.target;
        const newValue = (name === 'quilometragem_min' || name === 'quilometragem_max') ? parseInt(value, 10) || '' : value;
        const newFilters = { ...filters, [name]: newValue };
        setFilters(newFilters);
        onFilterChange(newFilters);
    };

    const years = Array.from({ length: new Date().getFullYear() - 1949 }, (_, i) => new Date().getFullYear() - i);

    return (
        <div className="filter-sidebar">
            <h4>Filtros</h4>
            <div className="form-group">
                <label htmlFor="brand">Marca</label>
                <select className="form-control" id="brand" name="brand" value={filters.brand} onChange={handleInputChange}>
                    <option value="">Todas</option>
                    {brands.map((brand) => (
                        <option key={brand.id} value={brand.id}>{brand.nome}</option>
                    ))}
                </select>
            </div>
            <div className="form-group">
                <label htmlFor="model">Modelo</label>
                <select className="form-control" id="model" name="model" value={filters.model} onChange={handleInputChange}>
                    <option value="">Todos</option>
                    {models.map((model) => (
                        <option key={model.id} value={model.id}>{model.nome}</option>
                    ))}
                </select>
            </div>
            <div className="form-group">
                <label htmlFor="year">Ano</label>
                <select className="form-control" id="year" name="year" value={filters.year} onChange={handleInputChange}>
                    <option value="">Todos</option>
                    {years.map((year) => (
                        <option key={year} value={year}>{year}</option>
                    ))}
                </select>
            </div>
            <div className="form-group">
                <label htmlFor="quilometragem_min">Quilometragem Mínima</label>
                <input
                    type="number"
                    className="form-control"
                    id="quilometragem_min"
                    name="quilometragem_min"
                    value={filters.quilometragem_min}
                    onChange={handleInputChange}
                />
            </div>
            <div className="form-group">
                <label htmlFor="quilometragem_max">Quilometragem Máxima</label>
                <input
                    type="number"
                    className="form-control"
                    id="quilometragem_max"
                    name="quilometragem_max"
                    value={filters.quilometragem_max}
                    onChange={handleInputChange}
                />
            </div>
        </div>
    );
};

export default FilterSidebar;
